 getSubtaskMean: function(metric, subtask){//getSubtaskMean("nog","2230300"); returns mean if two or three trials are available
 	var trialCount = this['trialCount'][subtask];
   	if (typeof trialCount == 'undefined'){
   	  error('driving.getSubtaskMean() undefined:' +subtask);
	  return null;
  	}else{
	 var temp = this['expData'][metric][subtask];
	  if (typeof temp == 'undefined'){
   	    error('driving.getSubtaskMean() undefined:' +subtask);
	    return null;
  	  }else{
	   if (trialCount > 1){
		var temp2 = this['expData'][metric][String(parseInt(subtask)+100)];//second trial => code x400
		temp = math.add(temp, temp2); 
	    }
	   if (trialCount > 2){
		var temp3 = this['expData'][metric][String(parseInt(subtask)+200)];//third trial => code x500
		temp = math.add(temp, temp3); 
	    }

	   return math.divide( temp, trialCount);//return mean
	  }
	
	}
 },

  calculateSum : function(metric, subtaskArray){//return sum of subtasks for "metric"; input is subtask array e.g. ["2180300", "2190300", "2080300"]
    if ((!subtaskArray)||(subtaskArray.length==0)){return null;}

    var sumArray = [];

    for(var i = 0; i< subtaskArray.length; i++){
		var subtask = String(subtaskArray[i]);
		var trialCount = this['trialCount'][subtask];
	   	if (typeof trialCount == 'undefined'){
	   	  error('driving.calculateSum() undefined:' +subtask);
	  	}else{
			 var tempSubTask = this.getSubtaskMean(String(metric),subtask);//mean , if more than one trial
			 if(sumArray.length > 0){
			   sumArray= math.add(sumArray, tempSubTask);//sum
			 }else{
			   sumArray = tempSubTask;
			 }	
		}     
    }//for

    return sumArray;	
 },
  
 calculateSumNormalized : function(metric, subtaskArray){//return sum of subtasks for "metric" normalized by duration; input is subtask array e.g. ["2180300", "2190300", "2080300"]
    if ((!subtaskArray)||(subtaskArray.length==0)){return null;}

    var sum = this.calculateSum(metric, subtaskArray);
    var duration = this.calculateSum("duration", subtaskArray);
 	var retValue = math.dotDivide(sum,math.transpose(duration));//normalize
 	return math.multiply( retValue, 1000.0*1000.0);//normalization by duration is in millisec convert to seconds (*1000); multiply also by 1000 to get millimeter/seconds for DLP and millimeter/seconds for DHW
 },
 
 
  calculateDetRel : function(metric, subtaskArray){//return percent deterioriation in performance; input is subtask array e.g. [2180300", "2190300", "2080300"]
    if ((!subtaskArray)||(subtaskArray.length==0)){return null;}

	performanceWithTask = this.calculateSumNormalized(metric, subtaskArray);
	
	if (metric == 'sumAbsDiffLanePosition'){
     performanceBaseline = driving['baseline']['normSumAbsDiffLanePosition'];
    }
	if (metric == 'sumAbsDiffTimeHeadway'){
     performanceBaseline = driving['baseline']['normSumAbsDiffTimeHeadyway'];
    }
     
	var retValue = [];
	math.forEach(performanceWithTask, function(value, index) {
	  if(isNaN(value) || (value == 0)){
		retValue[index] = [];
	  }else{
		retValue[index] = 100* (performanceWithTask[index] - (performanceBaseline[index] *1000))/* scale baseline metric to mm/s and ms/s */  / (performanceBaseline[index] *1000) ;
	  }
	});

	return retValue;
  },
 
 
  percentages : function(metric, subtaskArray){//returns the average influence percentages of subtasks for chart visualization e.g. ["2180300", "2190300", "2080300"] could return [0.2, 0.5, 0.3]

    if ((!subtaskArray)||(subtaskArray.length==0)){return null;}

    var total = math.mean(this.calculateSum(metric, subtaskArray));
    var retValue = [];
    for(var i = 0; i< subtaskArray.length; i++){
	    var subtask = String(subtaskArray[i]);
	    var tempSubTask = this.getSubtaskMean(String(metric),subtask);
	    var temp = math.mean(tempSubTask);
	    retValue.push(temp/parseFloat(total));
	}
	
	return math.multiply(retValue,100.0);
 },
 
 meansNorm : function(metric, subtaskArray){//returns the  mean of each single subtask  for chart visualization e.g. ["2180300", "2190300", "2080300"] could return [2, 5, 1]
    if ((!subtaskArray)||(subtaskArray.length==0)){return null;}

    var retValue = [];
    for(var i = 0; i< subtaskArray.length; i++){
	    var subtask = String(subtaskArray[i]);
	    var tempSubTask= [];
	    //tempSubTask = this.calculateSumNormalized(String(metric),[subtask]);	        
	    tempSubTask = this.calculateDetRel(String(metric),[subtask]);	        
	    var temp = math.mean(tempSubTask);
	    retValue.push(temp);
	}
	
	return retValue;
 },
 
 bootstrap : function(metric, subtaskArray, limit, runs){//driving.bootstrap("tttbase", [2150300","2230300"], 15000, 200); occ.bootstrap("tttocc", [2150300","2230300"], 15000); how often (%) the bootstraped result is above the limit
    if ((!subtaskArray)||(subtaskArray.length==0)){return null;}

	//var temp = this.calculateSumNormalized(metric,subtaskArray);	
	var temp = this.calculateDetRel(metric,subtaskArray);	
	
	var rng = new Math.seedrandom(77);//needs seedrandom.min.js
    var resultArray = []
	var belowLimitCount = 0;
    
	for(var i=0; i<runs;i++){
		//construct idx array
		var idx = [];
		for(var n=0; n<temp.length; n++){
			var t = Math.abs(rng.int32()) % temp.length;
			idx.push(t);
		}
		
		//var result = math.quantileSeq(arrayIdx(temp, idx),0.85);
		var result = math.median(arrayIdx(temp, idx));
		if (result < limit){belowLimitCount++;}		
	}
	return ((belowLimitCount/parseFloat(runs))*100.0);	
 }
 
